query FetchSalesGraph($productId: String!, $currencyCode: CurrencyCode, $intervals: Int, $startDate: String, $endDate: String, $isVariant: Boolean! = false) {
  variant(id: $productId) @include(if: $isVariant) {
    id
    salesChart(
      currencyCode: $currencyCode
      intervals: $intervals
      startDate: $startDate
      endDate: $endDate
    ) {
      ...SalesGraph
    }
  }
  product(id: $productId) @skip(if: $isVariant) {
    id
    title
    productCategory
    salesChart(
      currencyCode: $currencyCode
      intervals: $intervals
      startDate: $startDate
      endDate: $endDate
    ) {
      ...SalesGraph
    }
  }
}

fragment SalesGraph on SalesChart {
  series {
    xValue
    yValue
  }
}
